%[text] ## Proyecto: Control de circuito RC
%[text] ###  **Función de transferencia del modelo de la planta**
%[text] Planta `P`
s=tf('s');

% Valores nominales
% R1 = 10*10^(3);
% R2 = 10*10^(3);
% C1 = 100*10^(-6);
% C2 = 100*10^(-6);

% Valores experimentales
R1 = 9.960*10^(3);
R2 = 9.860*10^(3);
C1 = 94.5*10^(-6);
C2 = 94.7*10^(-6);

% Función de transferencia de lazo abierto
P=1/(R1*R2*C1*C2*s^2 + (R1*C1 + R1*C2 + R2*C2)*s + 1) %[output:4072e377]
%%
%[text] ### Diagrama de Bode de lazo abierto
fig = figure %[output:04c4125d] %[output:063dfbef]
margin(P); %[output:063dfbef]

% Exportar svg
set(fig, 'Units', 'inches');
fig.Position(3:4) = [5 4]; % Ancho = 5 in, alto = 4 in %[output:063dfbef]
exportgraphics(fig, 'bode_lazo_abierto.svg', 'ContentType', 'vector'); %[output:063dfbef]
%%
%[text] ### Respuesta temporal de lazo abierto
% Tiempo
t = 0:0.001:20;

% Función escalón unitario
r = 1 * heaviside(t);

% Simular el sistema de lazo abierto
y = lsim(P, r, t);

% Graficar
fig = figure %[output:4b9c5c38] %[output:6672716a]
plot(t, r, 'r--', t, y, 'b') %[output:6672716a]
xlabel('Tiempo (s)'); %[output:6672716a]
ylabel('Amplitud'); %[output:6672716a]
% title('Respuesta de lazo abierto');
legend('Referencia r(t)', 'Salida y(t)'); %[output:6672716a]
grid on; %[output:6672716a]

% Exportar svg
set(fig, 'Units', 'inches');
fig.Position(3:4) = [3.5 2.5]; % Ancho = 3.5 in, alto = 2.5 in %[output:6672716a]
exportgraphics(fig, 'respuesta_lazo_abierto.svg', 'ContentType', 'vector'); %[output:6672716a]
%%
%[text] ### `Sisotool`
sisotool(P);
%%
%[text] ### Conversión de continuo a analógico
% Convertir controlador a discreto
t_muestreo = 0.1;

Cz = c2d(C, t_muestreo, 'zoh') %[output:2f6cc928]
%%
%[text] ### `Respuesta temporal continua de lazo cerrado`
% Tiempo
t = 0:0.01:6;

% Función escalón unitario
r = 1 * heaviside(t);

[y, t1] = step(IOTransfer_r2y, t); % Salida y
[u, t2] = step(IOTransfer_r2u, t); % Señal de control u

fig = figure; %[output:68cb8d29]
plot(t1, y, 'b'); %[output:68cb8d29]
hold on; %[output:68cb8d29]
plot(t2, u, 'g'); %[output:68cb8d29]
plot(t, r, 'r--'); %[output:68cb8d29]

xlabel('Tiempo (s)'); %[output:68cb8d29]
ylabel('Amplitud'); %[output:68cb8d29]
legend('Salida y(t)', 'Control u(t)', 'Referencia r(t)'); %[output:68cb8d29]
% title('Respuesta al escalón y señal de control');
grid on; %[output:68cb8d29]

ts = tiempo_asentamiento.Position(1);
ys = tiempo_asentamiento.Position(2);

% Línea vertical con estilo personalizado (en vez de xline)
plot([ts ts], ylim, '--', 'Color', [0.5 0.5 0.5], 'HandleVisibility', 'off'); %[output:68cb8d29]

% Etiqueta visual con estética limpia
text(ts, min(ylim) + 0.05, ... %[output:68cb8d29]
     sprintf('t_s = %.2f s', ts), ... %[output:68cb8d29]
     'VerticalAlignment', 'bottom', ... %[output:68cb8d29]
     'HorizontalAlignment', 'center', ... %[output:68cb8d29]
     'FontSize', 10, ... %[output:68cb8d29]
     'BackgroundColor', 'white', ... %[output:68cb8d29]
     'Margin', 2); %[output:68cb8d29]


% Marcador sobre la curva
plot(ts, ys, 'ko', 'MarkerFaceColor', 'b', 'MarkerSize', 3, 'HandleVisibility', 'off'); %[output:68cb8d29]
hold off; %[output:68cb8d29]

% Exportar svg
set(fig, 'Units', 'inches');
fig.Position(3:4) = [3.5 2.5]; % Ancho = 3.5 in, alto = 2.5 in %[output:68cb8d29]
exportgraphics(fig, 'respuesta_continua.svg', 'ContentType', 'vector'); %[output:68cb8d29]
%%
%[text] ### Respuesta temporal discreta de lazo cerrado
fig = figure %[output:7013fab2] %[output:534fe37e]

plot(out.y.Time, out.y.Data, '--', 'Color', [0.5, 0.5, 0.5]); %[output:534fe37e]
hold on; %[output:534fe37e]
plot(out.yz.Time, out.yz.Data, 'b'); %[output:534fe37e]
plot(out.uz.Time, out.uz.Data, 'g'); %[output:534fe37e]
plot(out.r.Time, out.r.Data, 'r--'); %[output:534fe37e]

% Extraer datos de la señal yz
yz_y = out.yz.Data;
yz_t = out.yz.Time;

% Calcular el valor final y la tolerancia del 2%
yz_final = yz_y(end);
yz_tol = 0.02 * abs(yz_final);

% Determinar los puntos dentro de la banda de 2%
yz_within_bounds = abs(yz_y - yz_final) <= yz_tol;

% Encontrar el tiempo de asentamiento
for k = 1:length(yz_within_bounds)
    if all(yz_within_bounds(k:end))
        yz_ts = yz_t(k);
        break;
    end
end

% Calcular sobrepaso máximo respecto al valor final
[yz_max, idx_max] = max(yz_y);
yz_tmax = yz_t(idx_max);
yz_overshoot = ((yz_max - yz_final) / abs(yz_final)) * 100;

% Indicar tiempo de asentamiento al 2%
plot([yz_ts yz_ts], ylim, '--', 'Color', [0.5 0.5 0.5], 'HandleVisibility', 'off'); %[output:534fe37e]
plot(yz_ts, yz_y(find(yz_t == yz_ts, 1)), 'ko', 'MarkerFaceColor', 'b', 'MarkerSize', 3); %[output:534fe37e]
text(yz_ts, min(ylim) + 0.05, ... %[output:534fe37e]
     sprintf('t_s = %.2f s', yz_ts), ... %[output:534fe37e]
     'VerticalAlignment', 'bottom', ... %[output:534fe37e]
     'HorizontalAlignment', 'center', ... %[output:534fe37e]
     'FontSize', 10, ... %[output:534fe37e]
     'BackgroundColor', 'white', ... %[output:534fe37e]
     'Margin', 2); %[output:534fe37e]

% Graficar el punto máximo
plot(yz_tmax, yz_max, 'ko', 'MarkerFaceColor', 'r', 'MarkerSize', 3); %[output:534fe37e]
text(yz_tmax-0.25, yz_max-0.25, ... %[output:534fe37e]
    sprintf('Overshoot\n%.4f%%', yz_overshoot), ... %[output:534fe37e]
    'HorizontalAlignment', 'center', ... %[output:534fe37e]
    'FontSize', 9, ... %[output:534fe37e]
    'BackgroundColor', 'white', ... %[output:534fe37e]
    'Margin', 2); %[output:534fe37e]

hold off; %[output:534fe37e]

% Labels y leyenda
xlabel('Tiempo (s)'); %[output:534fe37e]
ylabel('Amplitud'); %[output:534fe37e]
legend('Salida y(t)', 'Salida y(k)', 'Control u(k)', 'Referencia r(t)'); %[output:534fe37e]
grid on; %[output:534fe37e]

% Exportar svg
set(fig, 'Units', 'inches');
fig.Position(3:4) = [3.5 2.5]; % Ancho = 3.5 in, alto = 2.5 in %[output:534fe37e]
exportgraphics(fig, 'respuesta_discreta.svg', 'ContentType', 'vector'); %[output:534fe37e]
%%
%[text] ### Diagrama de Bode de lazo cerrado
fig = figure %[output:59bf8e32] %[output:7e601f1d]
margin(LoopTransfer_C); %[output:7e601f1d]

% Exportar svg
set(fig, 'Units', 'inches');
fig.Position(3:4) = [5 4]; % Ancho = 5 in, alto = 4 in %[output:7e601f1d]
exportgraphics(fig, 'bode_lazo_cerrado.svg', 'ContentType', 'vector'); %[output:7e601f1d]
%%
%[text] ### LGR de lazo cerrado
fig = figure %[output:0d2660c6] %[output:75a6839d]
rlocus(LoopTransfer_C); %[output:75a6839d]

% Exportar svg
set(fig, 'Units', 'inches');
fig.Position(3:4) = [3.5 2.5]; % Ancho = 3.5 in, alto = 2.5 in %[output:75a6839d]
exportgraphics(fig, 'rlocus.svg', 'ContentType', 'vector'); %[output:75a6839d]

